  e.preventDefault();
  console.log(e.target[0].value);
}

const App = () => {
  const [word, setWord] = useState('');

  return (
    <div>
      <Header title='Images Gallery'/>
      <Search word ={word} setWord={setWord} handleSubmit={handleSearchSubmit}/>
    </div>
  );
}

export default App;
